Главное из обращения Байдена по поводу Украины:

🔴Путин готовит почву для того, чтобы продвинуться дальше в Украину. Он попросил разрешение у Думы на это;
🔴 санкции против России коснутся суверенного долга РФ и российских элит;
🔴150 000 российских войск сосредоточено у границ Украины, они готовы к атаке;
🔴США продолжат помощь Украине в сфере обороны, санкции вводятся против элиты РФ и их семей.
🔴Если из Беларуси не выйдут войска РФ - будут усилены оборонным оружием Эстония, Литва и Латвия;
🔴признание "Л/ДНР" - очевидная провокация и нарушение международного права;
🔴оправданиям агрессии РФ нет, вчера Путин перекрутил историю;
🔴Россия не сможет продавать облигации и брать займы на мировых рынках;
🔴США не имеют никакого желания сражаться с РФ, но хотят донести, что будут защищать каждый дюйм территории НАТО.
🔴санкции  будут вводиться до такой степени, чтобы не ударить по американским гражданам.
🔴США работают с Германией над тем, чтобы "Северный поток 2" не был запущен

⚡️Президент РФ Путин заявил Шольцу и Макрону, что собирается подписать указ о признании независимости «ДНР» и «ЛНР», - сообщает росСМИ.

